// components/Menu.js
import React from 'react';
import { Link } from 'react-router-dom';

const Menu = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/student">Student</Link>
          </li>
          <li>
            <Link to="/faculty">Faculty</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Menu;
